DROP TABLE IF EXISTS `sudoku`;
CREATE TABLE sudoku (`id` integer PRIMARY KEY AUTOINCREMENT,`level` tinyint(1) NOT NULL DEFAULT '1',`sudoku` varchar(81) NOT NULL,`answer` varchar(81) DEFAULT NULL,`userdo` varchar(81) DEFAULT NULL,`used` int(11) DEFAULT '0',`finish` int(11) DEFAULT '0',`lastplay` timestamp NULL DEFAULT NULL);
